    return <Box> <Typography
    fontWeight="bold"
    fontSize="clamp(1rem, 2rem, 2.25rem)"
    color="primary"
    onClick={() => navigate("/home")}
    sx={{
      "&:hover": {
        color: primaryLight,
        cursor: "pointer",
      },
    }}
  >
    Sociopedia
  </Typography></Box>
};
export default LoginPage;
